import axios from 'axios';

export const getAllVisaServices = async () => {
  try {
    console.log(
      await axios.get('http://127.0.0.1:8000/api/service', {
        headers: {
          Authorization: 'Token b4e1b0ee69c8f174e1f897f2af70567fa31b4760'
        }
      })
    );

    return await axios.get('http://127.0.0.1:8000/api/service', {
      headers: {
        Authorization: 'Token b4e1b0ee69c8f174e1f897f2af70567fa31b4760'
      }
    });
  } catch (error) {
    console.log(error);
  }
};

export const getAllMigrationService = async () => {
  try {
    console.log(
      await axios.get('http://127.0.0.1:8000/api/service', {
        headers: {
          Authorization: 'Token b4e1b0ee69c8f174e1f897f2af70567fa31b4760'
        }
      })
    );

    return await axios.get('http://127.0.0.1:8000/api/service', {
      headers: {
        Authorization: 'Token b4e1b0ee69c8f174e1f897f2af70567fa31b4760'
      }
    });
  } catch (error) {
    console.log(error);
  }
};

export const getAllCategories = async () => {
  try {
    console.log(await axios.get('http://127.0.0.1:8000/api/category'));
    return await axios.get('http://127.0.0.1:8000/api/category');
  } catch (error) {
    console.log(error);
  }
};

export const getAllOrders = async () => {
  try {
    console.log(await axios.get('http://127.0.0.1:8000/api/order'));
    return await axios.get('http://127.0.0.1:8000/api/order');
  } catch (error) {
    console.log(error);
  }
};

export const getSingleVisaSevice = async (id) => {
  try {
    console.log(
      await axios.get(`http://127.0.0.1:8000/api/service/${id}`, {
        headers: {
          Authorization: 'Token b4e1b0ee69c8f174e1f897f2af70567fa31b4760'
        }
      })
    );

    return await axios.get(`http://127.0.0.1:8000/api/service/${id}`, {
      headers: {
        Authorization: 'Token b4e1b0ee69c8f174e1f897f2af70567fa31b4760'
      }
    });
  } catch (error) {
    console.log(error);
  }
};

export const getMedia = async () => {
  try {
    return await axios.get('http://127.0.0.1:8000/api/media');
  } catch (error) {
    console.log(error);
  }
};

export const getSingleOrder = async (id) => {
  try {
    return await axios.get(`http://127.0.0.1:8000/api/order/${id}`);
  } catch (error) {
    console.log(error);
  }
};

export const getSingleProduct = async (id) => {
  try {
    return await axios.get(`http://127.0.0.1:8000/api/product/${id}`);
  } catch (error) {
    console.log(error);
  }
};

export const getSingleCategory = async (id) => {
  try {
    return await axios.get(`http://127.0.0.1:8000/api/category/${id}`);
  } catch (error) {
    console.log(error);
  }
};
